import './App.css';
import {WrappedMap} from "./Components/GoogleMap/GoogleMapDiv"
function App() {
  return (
    <div className="App">
     <h1>AirBnb</h1>
      <div style={{width:"100vw",height:"180%"}}>
      <WrappedMap googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyDwlPh9xzA5q-o2dks8pVtUaD2vGMyMDiI`}
       loadingElement= {<div style={{ height: `100%` }} />}
       containerElement= {<div style={{ height: `400px` }} />}
       mapElement={<div style={{ height: `100%` }} />}
       />
      </div>
    </div>
  );
}

export default App;
